import React from "react";

const Cell = props => {
  let renderCell = () => {
    if (props.data.is_revealed) {
      if (props.data.is_mine === true) {
        return (
          <div className="cell open" onClick={() => props.open(props.data)}>
            m
          </div>
        );
      } else if (props.data.neighbour_mine_count === 0) {
        return (
          <div className="cell open" onClick={() => props.open(props.data)} />
        );
      } else
        return (
          <div className="cell open">{props.data.neighbour_mine_count}</div>
        );
    } else {
      return <div className="cell" />;
    }
  };

  return renderCell();
};

export default Cell;
